This will be a movie 😎

@TheGoddessBrunchATL was a MOVIE 🎥 it was a VIBE full of SISTERHOOD, SUCCESS, WISDOM, LOVE, Empowerment AND LAUGHS! Over 100 women came out and We are so happy to have honored Five Goddess Queens with Divine Goddess Awards, @jailenjosey, @gabrielleamani , @thetarynjanae @cherrypose ,  @operationsexibody , @rachelponder_ even surprised my head intern @nicoleconquers with her own bouquet of flowers for her consistent hard work, diligence, and loyalty being unmatched! Our Honorees/panelists were dropping MAJOR GEMS and inspired EVERYONE in that room, the transparency was unmatched and we covered so many important topics that each and every single generation in the room related with. Every single goddess that was in that room left different and empowered like no other❤️‍🔥 We are taking This Bi-Monthly experience around the GLOBE, and we are starting right here in ATL ❤️‍🔥

@besocialplease shutting down their ATL location and us being their last event at their venue is honorable and insane to me because just a year ago I was so scared to create all these new events, and now we just closed them out with EVENT NUMBER 7 Goddess brunch of over 100 women. Forever thankful for this venue space that allows us to come in and create such magic, It’s extremely difficult creating these events from scratch by the community shows us each day why it’s so important! It’s all GOD 🙏🏾 Community has given me the confidence to know I can do anything 🥺💖

THANK  you so much to everyone who came out from near and far, and even those of you that tried to fly in, the support and love that we receive from the community is heartwarming beyond words could explain 💖

🌸 STAY TUNED FOR OUR NEXT @THEGODDESSBRUNCHATL , WE MAY BE COMING TO A CITY NEAR YOU 😉🌸

